import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  background-color: white;
  padding-top: 23px;
`;

const TableHead = styled.div`
  width: 1072px;
  height: 54px;
  padding: 16px 60px 16px 32px;
  border-radius: 3px;
  background-color: #fafafa;
`;

const ThContainer = styled.span`
  margin: 0 0 0 30px;
`;

const TdContainer = styled.div`
  margin: 0 30px;
`;

const Tr = styled.tr`
  height: 54px;
  padding: 16px 0 0;
  background-color: #ffffff;
`;

const tableTitles = [
  { title: "Date/Time" },
  { title: "Name" },
  { title: "Device" },
  { title: "Payment" },
  { title: "BIN Number" },
  { title: "Amount" },
  { title: "Trans ID" },
  { title: "Decision" },
];

const tableContent = [
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "c",
    payment: "visa",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Approved",
  },
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "c",
    payment: "visa",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Approved",
  },
];

const TableHeaders = styled.tr`
  height: 54px;
  padding: 16px 60px 16px 32px;
  border-radius: 3px;
  background-color: #fafafa;
`;

const Table= styled.table`
width:100%`;

const renderTableHeader = () => {
  let header = Object.keys(tableTitles);
  return header.map((key, index) => {
    return <th key={index}>{tableTitles[key].title.toUpperCase()}</th>;
  });
};

const renderTableData = () => {
  return tableContent.map((transaction, index) => {
    const {
      date,
      name,
      device,
      payment,
      binNumber,
      amount,
      transId,
      decision,
    } = transaction;
    return (
      <Tr key={index}>
        <td><span>{date}</span></td>
        <td>{name}</td>
        <td>{device}</td>
        <td>{payment}</td>
        <td>{binNumber}</td>
        <td>{amount}</td>
        <td>{transId}</td>
        <td>{decision}</td>
      </Tr>
    );
  });
};
const TransactionLog = () => {
  return (
    <Container>
      <Table>
        <tbody>
          <TableHeaders>{renderTableHeader()}</TableHeaders>
          {renderTableData()}
        </tbody>
      </Table>
      {/* <TableHead>
        <tr>
          {tableTitles.map(({ title }) => (
            <ThContainer>
              <th>{title}</th>
            </ThContainer>
          ))}
        </tr>
      </TableHead> */}
      {/* {renderTableData()} */}
    </Container>
  );
};

export default TransactionLog;
